import {
  Button,
  message,
  Steps,
  theme,
  Cascader,
  DatePicker,
  Form,
  Input,
  InputNumber,
  Radio,
  Select,
  Switch,
  TreeSelect,
} from "antd";
import { useState } from "react";
import ContactDetailsForm from "../components/ContactDetailsFrom";
import FinishForm from "../components/FinishForm";
import PersonalDetailsForm from "../components/PersonalDetailsForm";
const PersonalDetails = () => {
  const [current, setCurrent] = useState(0);
  const [personalDetails, setPersonalDetails] = useState(null);
  const [contactDetails, setContactDetails] = useState(null);

  const onFinishPersonDetails = (values) => {
    setPersonalDetails(values);
    setCurrent(1);
  };
  const onFinishContactDetails = (values) => {
    setContactDetails(values);
    setCurrent(2);
  };
  const forms = [
    <PersonalDetailsForm onFinish={onFinishPersonDetails} />,
    <ContactDetailsForm onFinish={onFinishContactDetails} />,
    <FinishForm/>
  ];
  return (
    <div>
      <Steps
        style={{ padding: "32px 16px" }}
        onChange={setCurrent}
        current={current}
      >
        <Steps.Step title="Personal Details" />
        <Steps.Step title="Contact Details" />
        <Steps.Step title="Finish" />
      </Steps>
      {forms[current]}
    </div>
  );
};
export default PersonalDetails;
